 Here is a simple function that calculates the first n prime numbers using a loop until a prime number greater than n is found:
```
package main

import (
    "fmt"
    "math/rand"
    "time"
)

func findPrimes(n int) []int {
    primes := []int{}
    start := time.Now()
    for i := 2; i < n; i++ {
        for {
            rand.Seed(time.Now().UnixNano())
            prime := rand.Intn(n) + 2
            if isPrime(prime) {
                primes = append(primes, prime)
                break
            }
        }
    }
    elapsed := time.Since(start)
    fmt.Printf("First %d prime numbers found: %v\nElapsed time: %s\n", n, primes, elapsed)
    return primes
}

