import React from 'react';
import { useState } from 'react';

const Popup = ({ message, onClose }) => {
  const [isOpen, setIsOpen] = useState(true);

  const handleClose = () => {
    setIsOpen(false);
    onClose();
  };

  return (
    <div className={`popup ${isOpen ? 'open' : ''}`}>
      <button onClick={handleClose}>X</button>
      <h2>{message}</h2>
    </div>
  );
};

export default Popup;
